def check_access(file,type):
    global writeable

    if type == '1':
        file = f'/bin/{file}'
    elif type == '2':
        file = f'/usr/bin/{file}'
    elif type == '3':
        file = f'/sbin/{file}'


    if (os.access(file,os.X_OK)) == True:
        execute = ("\033[0;32m X\033[00m")
    else:
        execute = ("\033[0;31m X\033[00m")
    if os.access(file,os.W_OK) == True:
        write =('\x1b[6;30;42mW\x1b[0m')
        writeable += f'{file}\n'
    else:
        write = ("\033[0;31m W\033[00m")
    if os.access(file, os.R_OK) == True:
        read = ("\033[0;32m R\033[00m")
    else:
        read = ("\033[0;31m R\033[00m")

    return print(read,write,execute)


def bin_check(scan_type):
    if scan_type == 'u':

        for file in local_bin:
            if file not in ubuntu_bin:
                print(f"(+) Found Custom Binary: /bin/{file}  ", end='')
                access = str((check_access(file, "1")))
    if scan_type == 'f':
        for file in local_bin:
            print(f"(+) Found  Binary: /bin/{file}  ", end='')
            access = str((check_access(file, "1")))

def usr_bin_check(scan_type):
    if scan_type == 'u':
        for file in local_usr_bin:
            if file not in ubuntu_usr_bin:
                print(f"(+) Found Custom Binary: /usr/bin/{file}  ",end='')
